import React, { Component, Fragment } from 'react';
import withStyles from '@material-ui/core/styles/withStyles';
import PropTypes from 'prop-types';
// import AppIcon from '../images/ori_logo.png';
import Typography from '@material-ui/core/Typography';
import noImg from '../../../images/no-pic.png';

//mui studd
import Grid from '@material-ui/core/Grid'
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import CircularProgress from '@material-ui/core/CircularProgress';
//redux stuff
//Redux stuf
// import { connect } from 'react-redux';
// import { signupUser } from '../redux/actions/userActions'

const Link = require("react-router-dom").Link


const styles = {
    imgs: {

    },
    container: {

    }

}

class registration extends Component {
    render() {
        return (
        <Fragment>
            <h1>REGRISTRATION MODULES</h1>
            <div style={styles.container}>
                <div>
                    <Button color="inherit" component={Link} to="/admin-register" >
                        <img src={noImg} alt="picture" />
                    </Button>
                </div>
                <div>
                    <Button color="inherit" component={Link} to="/user-register" >
                        <img src={noImg} alt="picture" />
                    </Button>
                </div>
                <div>
                    <Button color="inherit" component={Link} to="/client-register" >
                        <img src={noImg} alt="picture" />
                    </Button>
                </div>
            </div>
        </Fragment>
        )
    }
}


export default registration;
